/* eslint-disable jsx-a11y/img-redundant-alt */
import React, { useContext } from "react";
import {
  MDBBtn,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBInput,
  MDBCheckbox,
  MDBIcon,
} from "mdb-react-ui-kit";
import { Link } from "react-router-dom";
import RegisterPage from "./RegisterPage";
import AuthContext from "../context/AuthContext";
import "../static/css/LoginPage.css"
import { useGoogleLogin } from "@react-oauth/google";
import { useNavigate } from "react-router-dom";
import GoogleButton from "react-google-button";


function LoginPage() {

  const {loginUser} = useContext(AuthContext)
  console.log(loginUser)
  
  const handleLogin = (e) => {
    e.preventDefault()
    const email = e.target.email.value
    const password = e.target.password.value

    email.length > 0 && loginUser(email, password)

    console.log(email)
    console.log(password)

  }


  const navigate = useNavigate();
  const login = useGoogleLogin({
    onSuccess: async (codeResponse) => {
      console.log(codeResponse);
            try {
              const userData = await fetch(
                `https://www.googleapis.com/oauth2/v3/userinfo?access_token=${codeResponse.access_token}`,
                {
                  headers: {
                    Authorization: `Bearer ${codeResponse.access_token}`,
                    Accept: "application/json",
                  },
                }
              );

              const userInfo = await userData.json();
              console.log(userInfo);
            } catch (error) {
              console.log(error);
            }
      const user = {
        backend: "google-oauth2",
        client_id: "iBzvk3Uq6XssKDLrEhGMqYlsVKMmeHucErk1GjqF",
        client_secret:
          "vxW4H3xKXwNL6z3bXTheBEsQjgP9upCgglItvvPr5R3CWl8TaJZG1gl9Ae5RgqPbLQ51N8csSVgcWE88TETAqhpRXFwcvEBpAr6dvi34yOOfAnbQc8ha7aa6yOiYMjgn",
        grant_type: "convert_token",
        token: codeResponse.access_token,
      };

      try {
        const response = await fetch(
          "http://127.0.0.1:8000/api-auth/convert-token",
          {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            withCredential: true,
            body: JSON.stringify(user),
          }
        );
        const data = await response.json();
        console.log("data: ", data);
        if (response.status === 200) {
          console.log("loggedin");
          localStorage.setItem("access_token", data.access_token);
          navigate("/home");
        } else {
          console.log(response.status);
          console.log("there was a server issue");
          alert("something went wrong " + response.status);
        }
      } catch (error) {
        console.log(error);
      }
    },
    flow: "implicit",
  });


  return (
    <div className="loginContainer">
      <MDBRow>
        <MDBCol col="6" md="6">
          <img
            src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-login-form/draw2.webp"
            class="img-fluid"
            alt="Sample image"
          />
        </MDBCol>

        <MDBCol col="6" md="6">
          <div className="d-flex flex-row align-items-center justify-content-center">
            <button onClick={() => login()}>
              Sign in with Google
            </button>
          </div>

          <div className="divider d-flex align-items-center my-4">
            <p className="text-center fw-bold mx-3 mb-0">Or</p>
          </div>

          <form onSubmit={handleLogin}>
            <MDBInput
              wrapperClass="mb-4"
              label="Email address"
              id="formControlLg"
              type="email"
              size="lg"
              name="email"
            />
            <MDBInput
              wrapperClass="mb-4"
              label="Password"
              id="formControlLg"
              type="password"
              size="lg"
              name="password"
            />

            <div className="d-flex justify-content-between mb-4">
              <MDBCheckbox
                name="flexCheck"
                value=""
                id="flexCheckDefault"
                label="Remember me"
              />
              <a href="!#">Forgot password?</a>
            </div>

            <div className="text-center text-md-start mt-4 pt-2">
              <MDBBtn className="mb-0 px-5" size="lg" type="submit">
                Login
              </MDBBtn>
              <p className="small fw-bold mt-2 pt-1 mb-2">
                Don't have an account? <Link to="/register"> Register </Link>
              </p>
            </div>
          </form>
        </MDBCol>
      </MDBRow>
    </div>
  );
}

export default LoginPage;
